var GPPreloader = Class.extend({

	_init: function() {

		var self = this;

		this.value = 0;
		this.total = 100;
		this.logo = new Image();
		this.ready = false;

		this.logo.onload = function() {
			self.ready = true;
		};
		$(this.logo).attr("src", "data:image/png;base64,");
	},

	Init: function(callback) {
		$(_gp.CScreen._canvas).fadeOut(0);

		var self = this;
		if(!this.ready) {			
			setTimeout(function() { self.Init(callback); }, 1000);
		}
		else
		{
			this.Draw();
			$(_gp.CScreen._canvas).fadeIn(2000, function() {
				if(callback)
					callback();
			});
		}
	},

	Draw: function() {
		_gp.CScreen.clear();

		var c = _gp.CScreen._ctx;
		var padding = 2;
		var totalWidth = _gp.CScreen.options.size[0] - (padding * 2);
		var width = ((this.value * 100 / this.total) * totalWidth / 100) - padding - 2;
		var height = 8;
		if(width < 0)
			width = 0;

		c.save();

		c.fillStyle = "#FFFFFF";
		c.strokeStyle = "#FFFFFF";

		c.strokeRect(
			padding, 30 + (_gp.CScreen.options.size[1] / 2) - height / 2, 
			totalWidth, height
		);

		c.fillRect(
			padding + 2, 30 + ((_gp.CScreen.options.size[1] / 2) - height / 2) + 2,
			width, height - padding * 2
		)

		c.restore();		

		c.save();		
		c.translate(
			_gp.CScreen.options.size[0] / 2 - ( (48 * this.logo.height / this.logo.width) / 2 ), 
			20 + _gp.CScreen.options.size[1] / 2 - (48 * this.logo.height / this.logo.width)
		);
		c.drawImage(this.logo, 0, 0, 48, 48 * this.logo.height / this.logo.width);
		c.restore();

	},

	End: function(callback) {
		$(_gp.CScreen._canvas).fadeOut(2000, function() {
			if(callback)
				callback();
		});
	}

});